using Microsoft.EntityFrameworkCore;
using portal_api.Model;
using System;

namespace portal_api.Context
{
    /// <summary>
    /// The main database context storing the data related to the PicturePortal.
    /// </summary>
    public class PictureContext : DbContext
    {
        public PictureContext(DbContextOptions<PictureContext> options) : base(options) { }

        public DbSet<PictureEntry> Pictures { set; get; }
        public DbSet<PortalUser> PortalUsers { set; get; }
        public DbSet<RequestItem> RequestItems { set; get; }

        /// <summary>
        /// Inserts some test data.
        /// </summary>
        /// <param name="builder"></param>
        protected override void OnModelCreating(ModelBuilder builder)
        {
            builder.Entity<PictureEntry>()
                .HasOne(e => e.Creator)
                .WithMany(e => e.PictureEntries)
                .OnDelete(DeleteBehavior.SetNull);

            builder.Entity<RequestItem>()
                .HasOne(e => e.RelatedPerson)
                .WithMany()
                .OnDelete(DeleteBehavior.SetNull);

            base.OnModelCreating(builder);

            PortalUser user1 = new PortalUser
            {
                UserId = 1,
                Username = "Max Mustermann",
                Mail = "max@mustermann.at",
                Password = "asdf",
                PictureEntries = null,
                IsAdmin = false
            };

            PortalUser user2 = new PortalUser
            {
                UserId = 2,
                Username = "Admin",
                Mail = "admin@portal.at",
                Password = "admin",
                PictureEntries = null,
                IsAdmin = true
            };

            PictureEntry p1 = new PictureEntry
            {
                PictureId = 1,
                Title = "Testbild 1",
                CreatorUserId = user1.UserId,
                CreationDate = new DateTime(),
                Image = Convert.FromBase64String(""),
                Tag = "Test"
            };


            PictureEntry p2 = new PictureEntry
            {
                PictureId = 2,
                Title = "Testbild 2",
                CreatorUserId = user1.UserId,
                CreationDate = new DateTime(),
                Image = Convert.FromBase64String(""),
                Tag = "Test"
            };

            builder.Entity<PortalUser>().HasData(user1, user2);

            builder.Entity<PictureEntry>().HasData(p1,p2);

            builder.Entity<RequestItem>().HasData(
                new RequestItem
                {
                    RequestId = 1,
                    Description = "Testticket",
                    RelatedPersonUserId = user1.UserId,
                    RelatedPicturePictureId = p1.PictureId,
                    Title = "Wos is mid du?"
                },
                new RequestItem
                {
                    RequestId = 2,
                    Description = "Der hod mei Copyright verletzt mimimi",
                    RelatedPersonUserId = user1.UserId,
                    RelatedPicturePictureId = p2.PictureId,
                    Title = "Sofort löschen!"
                }
            );
        }
    }
}
